import{_ as a}from"./chunks/index.VAya1KE4.js";import{c,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":"雅","idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":996,"name":"雅","summary":"星见 雅","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/09/82500917/8facd72e9178da44d0708bfc4e1d5ade_1655620996938124425.jpg","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/eb755a658e266c1081752a28bac78175_174568826940532525.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/09/82500917/5aa686d03aa0e8c61d7679cda1a099c2_7804749861928284167.png"},"attrs":[["稀有度","S"],["属性","烈霜"],["特性","异常"],["阵营","H.S.O.S.6"]],"destiny":[["LEVEL1雪上加霜","在[霜月架势]期间，每消耗1点[落霜]，[普通攻击：霜月]将无视目标6%防御力，最多叠加6层，退出[霜月架势]后增益效果结束；在[普通攻击：霜月]中进行三段蓄力，斩击命中处于[霜灼]状态下的敌人时，可以立即消除目标的[霜灼]状态，并使全队属性异常积蓄效率提升20%，持续10秒。雅自幼起便喜欢吟诵霜雪相关的诗句，即使初见时不能完全理解，但她依旧日复一日地思索着。不知不觉间，她已明悟出其中的真意不是在某个清朗的雪夜，而是在刀刃相向的战场上。"],["LEVEL2吐纳法","[普通攻击：风花]和[闪避反击]造成的伤害提升30%；第五段[普通攻击：风花]最后一击命中敌人时，星见雅获得1点[落霜]；进入战场时，星见雅立刻获得6点[落霜]，自身暴击率提升15%。「刀刃如常，心亦如是。」这是星见流剑术的训诫之一击倒敌人只是致胜的第一步，在战斗中不失从容之心保持毫不懈怠的仪态始终如一，才是武者的修行之道。"],["LEVEL3武者修养","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2武家出身的雅有着极好锻炼习惯，剑术修行是不能断的。什么?要开会?那就翘掉开会。"],["LEVEL4皲裂","[霜灼·破]造成的伤害提升30%，触发[霜灼·破]时，星见雅额外获得250点喧响值。战斗时轻吟诗句，可以调节呼吸的节律。无论是心境还是呼吸，少女都时刻保持在盛开前的最佳状态。"],["LEVEL5纪念日","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2少女带着鲜花来到那个熟悉的地方，呼出的气化作白雾，融化在冰冷的空气里，她的指尖轻轻抚过纪念碑上的那个名字。周围的一切都很安静，如同最沉默的见证者。"],["LEVEL6天资卓越","在[霜月架势]期间，星见雅将获得[极意]效果，使[普通攻击：霜月]造成的伤害提升30%，获得[极意]效果后，消耗[落霜]时，星见雅会根据当前蓄力段数，自动拔刀向前方发动强力斩击；在[落霜]耗尽前，拔刀斩击不会打断[霜月架势]下的蓄力进度；在一次[霜月架势]期间，最多连续发动3次拔刀斩击。经历的战斗数量越多，越是能让外人察觉到一个事实:若是有刀剑的神灵存在，那他们一定颇为偏爱星见雅。"]],"skill":[{"title":"普通攻击：风花","desc":"点按发动：向前方进行至多五段的斩击，前两段造成物理伤害，后三段造成烈霜伤害；第五段[普通攻击]发动期间可以格挡敌人的攻击。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/db24297d986c7826ed8a8f31179a0723_6440129073478044674.gif"},{"title":"普通攻击：霜月","desc":"拥有2点或以上[落霜]时，长按发动：星见雅收刀进入[霜月架势]并开始蓄力，每段蓄力会消耗2点[落霜]，最多可以进行三段蓄力，松开或[落霜]耗尽时，星见雅将根据当前蓄力段数，拔刀向前方发动强力斩击，造成大量烈霜伤害，随后退出[霜月架势]；[霜月架势]期间拥有无敌效果；星见雅最多6点[落霜]，进入战场时，星见雅立刻获得3点[落霜]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/0e4d844a032e96fab42c7b99c1ff8427_1492955092003961187.gif"},{"title":"普通攻击：霜月（二段蓄力）","desc":"","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/aab8a2aaaa82f7d25c8dbd308a7017a3_8747238308026517464.gif"},{"title":"普通攻击：霜月（三段蓄力）","desc":"","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/d47a4f4a0b6e2a68ecc846eed0afb677_4682404863959202527.gif"},{"title":"闪避：水鸟","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。闪避时，连点或长按发动：长距离的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/d7ee984f5dbaf1cbafc542a0802bd7e7_4400563892937987209.gif"},{"title":"冲刺攻击：冬蜂","desc":"闪避时，点按发动：向前方进行斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/72c93c360957b2a59f80efeb1d46ca1f_3839605106923839353.gif"},{"title":"闪避反击：寒雀","desc":"触发[极限闪避]后，点按发动：对前方敌人发动斩击，造成烈霜伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/a79e8d26dcf62c5104aca7aea47bb9df_4850936098582489656.gif"},{"title":"闪避：水鸟（长按）","desc":"","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/7c11cafc35fb07dc1650f9b9f1aad9af_1747539268099916161.gif"},{"title":"快速支援：花信风","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动斩击，造成烈霜伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/271f3ca7e7e02842d56722121d72541c_6720558716514161679.gif"},{"title":"招架支援：花筏","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/c6a653ec67bb7616f7af8c87a3f9a068_9007154582990279615.gif"},{"title":"支援突击：花辞","desc":"发动[招架支援]后，点按发动：对前方敌人发动突进斩击，造成烈霜伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/dfce1ba38ac28ef3f533ec797009852b_7159744366874984996.gif"},{"title":"特殊技：深雪","desc":"点按发动：快速拔刀向前方进行斩击，造成烈霜伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/d35e0d5111d8f9e8d3e02daec4bc058f_7300871071952782996.gif"},{"title":"强化特殊技：飞雪","desc":"能量足够时，点按发动：快速突进，对路径上的敌人发动强力斩击，造成大量烈霜伤害；招式发动时，获得2点[落霜]；招式发动期间拥有无敌效果。招式发动后，能量足够时，再次点按发动：额外消耗能量，对前方范围内的敌人发动强力追击，造成大量烈霜伤害；招式发动时，获得2点[落霜]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/e03f8c5a6c140b5ca7d2ce6ac8524659_748654978453018749.gif"},{"title":"强化特殊技：飞雪（二段）","desc":"","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/15/82500917/497eeb0b309f9533c34138760cffb0de_3277579949968757720.gif"},{"title":"连携技：春临","desc":"触发[连携技]时，选择对应角色发动：对前方大范围敌人发动强力斩击，造成大量烈霜伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/a050adbcf44381b84974206ec6f5a80d_582754880226103840.gif"},{"title":"终结技：名残雪","desc":"喧响等级达到[极]时，点按发动：对前方大范围敌人发动强力斩击，略作延迟后发动终结一击，造成大量烈霜伤害；招式发动时，获得3点[落霜]，自身造成的冰属性伤害提升30%，持续12秒；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/ffbc0a7c4687e1a181c17353229f2076_2290647382359828050.gif"},{"title":"","desc":"核心被动：寒炎星见雅对敌人造成烈霜伤害时，将会为目标附着[冰焰]，持续30秒；对附着[冰焰]的敌人累积烈霜异常积蓄值时，会基于星见雅暴击率的100%提升烈霜异常积蓄效率，最多提升80%；星见雅累积烈霜异常积蓄值时，具有独立的属性异常积蓄槽，随之触发的[冻结]、[碎冰]和[霜寒]效果，可以与包括冰属性异常效果在内的其他属性异常效果互相结算[紊乱]；星见雅对附着[冰焰]的敌人施加[霜寒]效果时，将会消除[冰焰]并触发[霜灼·破]，对目标造成星见雅750%攻击力的烈霜伤害，同时使目标进入[霜灼]状态；[霜灼]状态下，全队对目标累积的属性异常积蓄值提升14%，但星见雅无法再次为其附着[冰焰]；[霜灼]状态将会随本次[霜寒]效果一起结束，状态持续期间，对敌人重新施加属性异常效果可以覆盖[霜寒]并消除[霜灼]；触发[霜灼·破]时，星见雅获得1点[落霜]，10秒内最多触发一次。(此处数据为初始数据)额外能力：同沐霜雪队伍中存在[支援]角色或与自身阵营相同的角色时触发：[普通攻击：霜月]造成的伤害提升60%；队伍中任意角色触发[紊乱]效果时，星见雅获得2点[落霜]，且在下一次[霜月架势]期间，[普通攻击：霜月]将无视目标30%冰属性伤害抗性。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/07/82500917/cf68165928178c0fe587ca159dd82c3a_5923820502463530220.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/雅.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/雅.md"},h=Object.assign(d,{setup(i){return(p,n)=>(o(),c("div",null,[e(t(a))]))}});export{b as __pageData,h as default};
